import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const ViewTrips = () => {
  const [trips, setTrips] = useState([]);

  useEffect(() => {
    const fetchTrips = async () => {
      const response = await fetch('http://localhost:3003/viajes');
      const data = await response.json();
      setTrips(data);
    };
    fetchTrips();
  }, []);

  const handleDelete = async (id) => {
    const response = await fetch(`http://localhost:3003/viajes/${id}`, {
      method: 'DELETE'
    });
    if (response.ok) {
      setTrips(trips.filter(trip => trip.id !== id));
    }
  };

  return (
    <div>
      <h2>Consultar Viajes</h2>
      <table>
        <thead>
          <tr>
            <th>País</th>
            <th>Año</th>
            <th>Mes</th>
            <th>Duración</th>
            <th>Costo</th>
            <th>Km Recorridos</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {trips.map(trip => (
            <tr key={trip.id}>
              <td>{trip.pais}</td>
              <td>{trip.ano}</td>
              <td>{trip.mes}</td>
              <td>{trip.duracion}</td>
              <td>{trip.costo}</td>
              <td>{trip.km_recorrido}</td>
              <td>
                <button onClick={() => handleDelete(trip.id)}>Eliminar</button>
                <Link to={`/edit-trip/${trip.id}`}><button>Modificar</button></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ViewTrips;
